import React from 'react';
import pokemons from './data'

class Pokemon extends React.Component {
    render() {
        const {name, type, averageWeight: {measurementUnit, value}} = this.props;

        return (
					<div className='pokemon'>
						<div>
							<p>{name}</p>
							<p>{type}</p>
							<p>{`Avarege weight: ${value} ${measurementUnit}`}</p>
						</div>
					</div>
      	)
    }
}

export default Pokemon;
